import React from 'react';
import Header from './components/Header'


function App() {
  return (
    <div className="App">

      <div>
      <Routes>
        <Route path='home' element={<Home/>}/>
        <Route path='about' element={<About/>}/>
        <Route path='deals' element={<Deals/>}/>
      </Routes>
      </div>
    </div>
  );
}

export default App;
